message:
@admin, favor contactar para receber mais arquivos importantes.

Os novos protocolos de regulamentação Bancários Basel 4, Breton Woods 3 e ISO 2022, que entraram em vigor(full) em 02 de janeiro de 2023, que o obrigam os bancos a ter lastro em ouro e metais raros para fazer suas transações financeiras, em substituição ao sistema fiduciário que imprime dinheiro do nada, vão quebrar os Bancos globalistas. Os fundos trilionários Blackrock, Vanguard, Evergreen, Binance etc estão indo à bancarrota.  Essa é a razão pelo qual a aliança está esperando a quebradeira.

 O post da BolsonaroTv, da enigmática tela em branco sugere isto. Este arquivo quando aberto no photoshop causa um 'crash'. Como esperado acontecer no sistema financeiro em breve.

